@Kollosche_ offering this modern waterfront home bringing a true contemporary resort-style living designed to take advantage of magnificent views of the Broadwater, hinterland and the park. An architectural gem, which enjoys superb views out to the open water, and wide 27.9 metres* of water frontage, ideal for a large boat or a cruiser.

Marvel in luxurious, contemporary finishes, seamless layout through living, family, kitchen and dining room. Concrete construction, high ceilings, glass lift, fire place and bi-fold timber doors. Clever use of timber, glass and stone, this four-level residence has a contemporary tropical ambience - a fabulous luxury lifestyle awaits.

Contact @Kollosche_ for more information
